Udah siap ikut lomba makan kerupuk se-kelurahan nya? Atau, lomba panjat pinang nya?
Atau, ga ikutan, bagian dokumentasi nya aja. 😅😅😅 Menyambut hari jadi nya Indonesia, FORSAD ada berita baik buat yang suka fotografi, pintar mengabadikan momen dan semua-semua yang anti gabut dan butuh pulsa. Teman-teman bisa banget ikutan!!!⬇⬇⬇ LOMBA FOTOGRAFI 17 AGUSTUS 2018 FORSAD 🇲🇨🇲🇨🇲🇨 dengan tema "Indahnya Indonesia dengan ragam budaya nya". SYARAT DAN KETENTUAN:
1. Peserta merupakan anggota FORSAD;
2. Wajib mengikuti akun Instagram @forsadqm;
3. Foto diperbolehkan menggunakan kamera apapun;
4. Foto harus sesuai dengan tema;
5. Foto ASLI milik sendiri dan penyelenggara bebas dari tuntutat pihak manapun;
6. Lomba dimulai dari tanggal 17 s.d. 24 Agustus 2018. Foto yang diterima hanya foto yang dikirimkan pada periode yang sudah ditentukan;
7. Hasil akan diumumkan tanggal 27 Agustus 2018;
8. Unggah hasil foto di akun Instagram pribadi, dengan caption;
a. Nama peserta
b. Judul foto
c. Cerita foto
d. Tanggal dan waktu pengambilan foto
e. Jangan lupa tandai akun @forsadqm di unggahan kamu 😉
f. Lalu, tambahkan tagar #forsadqm #sinergiberkarya #forsadberkarya #forsad17an (boleh menambahkan tagar lainnya). Hadiah nya PULSA dengan jumlah yang ga main-main.😱😱😱 Jadi, tunggu apalagi? Cekrek hari ini, unggah, dapet pulsa dari FORSAD. Merdeka negara nya, merdeka juga pemuda nya dari kuota abis. Kan, lumayan bisa liat vidio ceramah di IG atau Instagram 😉😉😉 🇲🇨🇲🇨🇲🇨MERDEKA!!🇲🇨🇲🇨🇲🇨 #forsadqm
